      "content": "// contracts/EqueusUserRegistry.sol
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "./IEqueusUserRegistry.sol";
import "../base/WithOperators.sol";
import "../base/WithAuthOperators.sol";
import "../base/WithEqueusCheckoutGuard.sol";
import "hardhat/console.sol";

/**
 * @title EqueusUserRegistry
 * @dev EqueusUserRegistry contract. Manages the users of the Equeus ecosystem.
 */

contract EqueusUserRegistry is
    IEqueusUserRegistry,
    Ownable,
    WithOperators,
    WithAuthOperators,
    WithEqueusCheckoutGuard
{
    // Users
    mapping(string => User) public usernameToUser;
    mapping(address => string) public addrToUsername;

    // =============================================================
    //                          Constructor
    // =============================================================
    constructor() {}

    function importUser(
        string memory _user,
        string memory _sponsor,
        address _addr,
        uint256 _activeLines,
        uint256 _activeLinesExpireTime,
        bool _isSponsorshipEnabled
    ) external onlyOwner {
        _registerUser(
            _user,
            _sponsor,
            _addr,
            _activeLines,
            _activeLinesExpireTime,
            _isSponsorshipEnabled,
            false
        );
    }

    // =============================================================
    //                          Users
    // =============================================================

    /**
     * @dev A username is valid if it is not empty, contains only alphanumeric characters or underscore or dot or hyphen.
     * @param _username The username to check.
     *
     */
    function isValidUsername(
        string memory _username
    ) public pure returns (bool) {
        if (bytes(_username).length == 0) {
            // if username is empty return false
            return false;
        }

        bytes memory b = bytes(_username);
        for (uint i; i < b.length; i += 1) {
            bytes1 char = b[i];
            if (
                // 0-9
                (char >= 0x30 && char <= 0x39) ||
                // A-Z
                (char >= 0x41 && char <= 0x5A) ||
                // a-z
                (char >= 0x61 && char <= 0x7A) ||
                // underscore
                (char == 0x5F) ||
                // dot
                (char == 0x2E) ||
                // hyphen
                (char == 0x2D)
            ) {
                continue;
            } else {
                return false;
            }
        }
        return true;
    }

    /**
     * @dev Checks if a username exists.
     * @param _username The username to check.
     */
    function usernameExists(
        string memory _username
    ) public view returns (bool) {
        return usernameToUser[_username].createdAt != 0;
    }

    /**
     * @dev Registers a new user.
     * @param _username The username of the user.
     * @param _sponsor The sponsor of the user.
     * @param _addr The address of the user.
     * @param _activeLines The number of active lines of the user.
     * @param _activeLinesExpireTime The timestamp when the active lines of the user expire.
     * @param _isSponsorshipEnabled  Whether the user has sponsorship enabled.
     * @param _hasSocialMarketingSystemEnabled Whether the user has social marketing system enabled.
     */
    function _registerUser(
        string memory _username,
        string memory _sponsor,
        address _addr,
        uint256 _activeLines,
        uint256 _activeLinesExpireTime,
        bool _isSponsorshipEnabled,
        bool _hasSocialMarketingSystemEnabled
    ) internal {
        usernameToUser[_username] = User({
            username: _username,
            sponsor: _sponsor,
            addr: _addr,
            activeLines: _activeLines,
            activeLinesExpireTime: _activeLinesExpireTime,
            isSponsorshipEnabled: _isSponsorshipEnabled,
            kycVerified: false,
            createdAt: block.timestamp,
            hasSocialMarketingSystemEnabled: _hasSocialMarketingSystemEnabled
        });
        if (_addr != address(0)) {
            addrToUsername[_addr] = _username;
        }
        emit UserRegistered(_username, _sponsor, block.timestamp);
    }

    /**
     * @dev Registers a new user. Callable only by auth operators.
     * @param _username The username of the user.
     * @param _sponsor The sponsor of the user. The sponsor must be a registered user.
     */
    function registerUser(
        string memory _username,
        string memory _sponsor
    ) public onlyOperator {
        require(usernameExists(_username) == false, "username_exists");
        require(isValidUsername(_username), "invalid_username");
        require(usernameExists(_sponsor), "sponsor_does_not_exist");

        require(
            keccak256(abi.encodePacked(_username)) !=
                keccak256(abi.encodePacked(_sponsor)),
            "cannot_be_sponsor_of_self"
        );
        require(
            usernameToUser[_sponsor].createdAt != 0,
            "sponsor_does_not_exist"
        );
        require(
            usernameToUser[_sponsor].isSponsorshipEnabled,
            "sponsor_is_not_allowed"
        );

        _registerUser(_username, _sponsor, address(0), 0, 0, true, false);
    }

    /**
     * @dev sets the address of a user, and updates the reverse mapping. Callable only by auth operators.
     * @param _username The username of the user.
     * @param _addr The address of the user.
     */
    function setUserAddress(string memory _username, address _addr) public {
        // check if the address is already mapped to a username with keccak256
        require(usernameExists(_username), "username_does_not_exist");
        require(
            keccak256(abi.encodePacked(addrToUsername[_addr])) ==
                keccak256(abi.encodePacked("")),
            "address_already_in_use"
        );
        // ensure that _addr is not the zero address
        require(_addr != address(0), "address_is_required");

        // get user's current address
        address currentAddress = usernameToUser[_username].addr;
        if (currentAddress != address(0)) {
            // if user already has an address, the sender must be the current address
            // or an auth operator
            require(
                msg.sender == currentAddress || isAuthOperator(msg.sender),
                "only_current_address_or_auth_can_update"
            );
            delete addrToUsername[currentAddress];
        } else {
            // if user does not have an address, the sender must be an operator,
            // auth operator, or the owner
            require(
                isOperator(msg.sender) ||
                    isAuthOperator(msg.sender) ||
                    msg.sender == owner(),
                "only_operator_can_update"
            );
        }

        usernameToUser[_username].addr = _addr;
        addrToUsername[_addr] = _username;
        emit UserAddressUpdated(_username, _addr, block.timestamp);
    }

    function setUserAddressAdmin(
        string memory _username,
        address _addr
    ) public onlyOwner {
        require(usernameExists(_username), "username_does_not_exist");
        require(_addr != address(0), "address_is_required");
        usernameToUser[_username].addr = _addr;
        addrToUsername[_addr] = _username;
        emit UserAddressUpdated(_username, _addr, block.timestamp);
    }

    /**
     * @dev sets the kyc status of a user. Callable only by auth operators.
     */
    function setKYCVerified(
        string memory _username,
        bool _isVerified
    ) public onlyAuthOperator {
        require(usernameExists(_username), "username_does_not_exist");
        usernameToUser[_username].kycVerified = _isVerified;
        emit KYCVerified(_username, _isVerified, block.timestamp);
    }

    /**
     * @dev sets the sponsorship status of a user. Callable only by auth operators.
     */
    function getUserByAddress(
        address _addr
    ) external view override returns (User memory) {
        require(_addr != address(0), "address_is_required");
        string memory username = addrToUsername[_addr];
        require(usernameExists(username), "username_does_not_exist");
        return usernameToUser[username];
    }

    /**
     * @dev Returns the user by their username. If the user does not exist, returns an empty User struct.
     */
    function getUserByUsername(
        string memory _username
    ) external view returns (User memory) {
        return usernameToUser[_username];
    }

    /**
     * @dev Returns the sponsor of a user. If the user does not exist, returns an empty string.
     * @param _username The username of the user.
     */
    function getSponsor(
        string memory _username
    ) external view returns (string memory) {
        return usernameToUser[_username].sponsor;
    }

    /**
     * @dev Returns the address of a user by their username. If the user does not exist, returns address(0).
     */
    function getAddressByUsername(
        string memory _username
    ) external view returns (address) {
        return usernameToUser[_username].addr;
    }

    /**
     * @dev Returns if the user has the social marketing system enabled.
     * @param _username The username of the user.
     */
    function isSocialMarketingSystemEnabled(
        string memory _username
    ) public view returns (bool) {
        return usernameToUser[_username].hasSocialMarketingSystemEnabled;
    }

    /**
     * @dev Returns the data needed to process a commission.
     */
    function getCommissioninfo(
        string memory _username
    )
        external
        view
        returns (string memory, address, uint256, uint256, uint256)
    {
        return (
            usernameToUser[_username].sponsor,
            usernameToUser[_username].addr,
            usernameToUser[_username].activeLines,
            usernameToUser[_username].activeLinesExpireTime,
            usernameToUser[_username].createdAt
        );
    }

    /**
     * @dev Lets the checkout operator set the active lines of a user.
     */
    function setUserActiveLines(
        string memory _username,
        uint256 _activeLines,
        uint256 _activeLinesExpireTime
    ) external onlyCheckoutOperator {
        require(usernameExists(_username), "username_does_not_exist");
        // if _username is equal to corp1 or corp2, then set to 9
        if (
            (keccak256(abi.encodePacked(_username)) ==
                keccak256(abi.encodePacked("corp1"))) ||
            (keccak256(abi.encodePacked(_username)) ==
                keccak256(abi.encodePacked("corp2")))
        ) {
            usernameToUser[_username].activeLines = 9;
            usernameToUser[_username].activeLinesExpireTime =
                block.timestamp +
                365 days *
                1000;
            return;
        }
        usernameToUser[_username].activeLines = _activeLines;
        usernameToUser[_username]
            .activeLinesExpireTime = _activeLinesExpireTime;
    }

    /**
     * @dev Lets the checkout operator set the social marketing system enabled status of a user.
     */
    function setSocialMarketingSystemEnabled(
        string memory _username,
        bool _isEnabled
    ) external onlyCheckoutOperator {
        usernameToUser[_username].hasSocialMarketingSystemEnabled = _isEnabled;
    }

    /**
     * @dev Lets the owner set the sponsorship status of a user.
     */
    function setSponsorshipEnabled(
        string memory _username,
        bool _isEnabled
    ) external onlyOwner {
        require(usernameExists(_username), "username_does_not_exist");
        usernameToUser[_username].isSponsorshipEnabled = _isEnabled;
    }

    /**
     * @dev Lets the owner set the sponsor of a user.
     */
    function setUserSponsor(
        string memory _username,
        string memory _sponsor
    ) external onlyOwner {
        require(usernameExists(_username), "username_does_not_exist");
        require(usernameExists(_sponsor), "sponsor_does_not_exist");
        usernameToUser[_username].sponsor = _sponsor;
    }
}
"
